const Searchbar = ({ fetchTeams, teams }) => {
  const search = (e) => {
    e.preventDefault();
    let keyword = e.target.elements.keyword.value;
    console.log('Keyword: ' + keyword);
  }

  return (
    <section>
        <form method="post" onSubmit={search}>
          <input type="text" name="keyword" placeholder="Search league..." />
          <input type="submit" value="Search" />
        </form>
      {teams.map((team, i) => <div>{team.name}</div>)}
    </section>
  )
};

export default Searchbar;
